import './RegIndividual.scss';
import Titlebar from '../../components/TitleBar/TitleBar';
import RegAccMain from '../../components/RegAccMain/RegAccMain';

const RegIndividual = (props) => {
    const [error, setError] = useState(null);
    const [form, setForm] = useState({
        u_login: '',
        u_mail: '',
        u_password: '',
        u_passwordAgain: '',
        ci_name: '',
        ci_surname: '',
        ci_street: '',
        ci_number:'',
        ci_number_flat:'',
        ci_zip: '',
        ci_city:''
    });
    const handleSubmit = async (event) => {
        error.preventDefault()
        console.log('form submitted', form)
    }


    let addstyle = {
        display: 'none'
    }

    return(
        
        <div className="RegIndividual">
            <Titlebar title="Rejestracja konta indywidualnego"/>
            <div>
                <div classname="RegMain" style={addstyle}>
                    <RegAccMain className="RegMainContainer"/>
                </div>
            </div>
            <div className="MRegForm">

            </div>

        </div>
    )
}

export default RegIndividual;

